function Array2D(r){let t=[];for(let n=0;n<r;n++)t[n]=[];return t}function Mirror2DX(r){let t=Array2D(r.length);for(let n=0;n<r.length;n++)t[r.length-1-n]=r[n];return t}function Push2DX(r,t){let n=Array2D(r.length);for(let e=0;e<r.length;e++)n[e+t]=r[e];return n}function Mask2D(r,t){let n=r;for(let r=0;r<t.length;r++)for(let e=0;e<t[r].length;e++)t[r][e]&&(n[r][e]=t[r][e]);return n}function r(r=0,t=10){return round(random(r,t))}